//  Country lookup using offline quadtree generated by Yggdrasil.
//
//  This tool can be used to determine the country name at a given
//  WGS84 coordinate. Lookup is based on quadtree data stored in the remainder
//  of this file. This data can be compressed to under 20 KB, while providing
//  lookup accuracy under 40 km.
//
//  License: BSD
//  Author:  Leonard van Driel, 2013

#include <stdio.h>
#include <string.h>
#include <stdlib.h>
#include <time.h>

typedef struct YGNode {
    char type;
    union {
        const char *label;
        struct YGNode *nodes[4];
    };
} YGNode;

typedef struct {
    char *labelData;
    int labelSize;
    YGNode *nodeData;
    int nodeSize;
} YGTree;

int YGParseValue(const unsigned char **data) {
    unsigned char c = **data;
    int result = 0;
    if (c < 0x20) result = (result + *(*data)++) << 8;
    if (c < 0x40) result = (result + *(*data)++) << 8;
    if (c < 0x80) result = (result + *(*data)++) << 8;
    result += *(*data)++;
    if (c >= 0x80) return result - 0x80;
    if (c >= 0x40) return result - 0x4000;
    if (c >= 0x20) return result - 0x200000;
    if (c >= 0x10) return result - 0x10000000;
    return 0;
}

void YGParseNode(const unsigned char **data, YGNode *node, const char **labels, const char **last, YGNode **nodes) {
    unsigned char code = *(*data)++;
    for (int i = 0; i < 4; i++) {
        YGNode *n = (*nodes)++;
        node->nodes[i] = n;
        switch (code & 0xC0) {
            case 0x00: n->type = 1; n->label = ""; break;
            case 0x80: *last = labels[YGParseValue(data) - 1]; //falltru
            case 0x40: n->type = 1; n->label = *last; break;
            case 0xC0: YGParseNode(data, n, labels, last, nodes); break;
        }
        code <<= 2;
    }
}

void YGParseTree(const unsigned char **data, YGTree *tree) {
    if (strncmp((const char *)*data, "YGG:bn2:", 8)) return;
    *data += 8;
    int labelCount = YGParseValue(data);
    tree->labelSize = YGParseValue(data);
    int nodeCount = YGParseValue(data);
    YGParseValue(data);
    tree->labelData = malloc(tree->labelSize);
    memcpy(tree->labelData, *data, tree->labelSize);
    const char *l = tree->labelData;
    const char **labels = malloc(labelCount * sizeof(const char *));
    for (int i = 0; i < labelCount; i++) {
        labels[i] = (const char *)l;
        while (*l) l++;
        l++;
    }
    *data += tree->labelSize;
    tree->nodeSize = nodeCount * sizeof(YGNode);
    tree->nodeData = malloc(tree->nodeSize);
    const char *last = NULL;
    YGNode *nodes = tree->nodeData + 1;
    YGParseNode(data, tree->nodeData, labels, &last, &nodes);
    free(labels);
}

void YGFreeTree(YGTree *tree) {
    free(tree->labelData);
    free(tree->nodeData);
}

const char *YGLabelInNode(YGNode *node, double x, double y, double ox, double oy, double sx, double sy) {
    if (node->type == 1) return node->label;
    int index = 0;
    sx /= 2, sy /= 2;
    if (x >= ox + sx) index += 1, ox += sx;
    if (y >= oy + sy) index += 2, oy += sy;
    return YGLabelInNode(node->nodes[index], x, y, ox, oy, sx, sy);
}

const char *YGLabelInTree(YGTree *tree, double x, double y) {
    return YGLabelInNode(tree->nodeData, x, y, -180, -180, 360, 360);
}

const unsigned char ygg[];

int main(int argc, const char * argv[])
{
    YGTree tree;
    const unsigned char *data = ygg;
    YGParseTree(&data, &tree);
    if (argc == 3) {
        double x = atof(argv[2]), y = atof(argv[1]);
        const char *label = YGLabelInTree(&tree, x, y);
        printf("country at %.1f %c %.1f %c is %s\n", y>=0?y:-y, y>=0?'N':'S', x>=0?x:-x, x>=0?'E':'W', strlen(label) ? label : "none");
    } else if (argc == 2 && !strcmp(argv[1], "performance")) {
        printf("timing performance of random lookups (takes about 5 seconds)\n");
        clock_t start = clock();
        double duration = 0, correction = 0;
        int loops = 0;
        for (; duration < 5; loops++) {
            for (int i = 1000000; i; i--) {
                YGLabelInTree(&tree, (double)360 * rand() / RAND_MAX - 180, (double)180 * rand() / RAND_MAX - 90);
            }
            duration = (double)(clock() - start) / CLOCKS_PER_SEC;
        }
        start = clock();
        for (int i = loops; i; i--) {
            correction = (double)(clock() - start) / CLOCKS_PER_SEC;
        }
        printf("%i million lookups were performed, %.3f nano seconds per lookup\n", loops, (duration - correction) / loops * 1000);
    } else {
        printf("usage: lookup latitude longitude\n");
        printf("example output:\n");
        printf("country at 52N 5E is %s\n", YGLabelInTree(&tree, 5, 52));
        printf("country at 48N 122W is %s\n", YGLabelInTree(&tree, -122, 48));
    }
    YGFreeTree(&tree);
    return 0;
}

